import "./SideBar.css";
import { useNavigate } from "react-router-dom";

function SideBar() {
    const navigate = useNavigate();

    return(
        <nav className="sidebar">
            <button className="side-button" onClick={() => navigate("/")}>
                <span className="side-text">Home</span>
            </button>
            <button className="side-button">Profile</button>
            <button className="side-button">Character</button>
            <button className="side-button">Weapon</button>
        </nav>
    );
}

export default SideBar;
